import React from 'react'
import next from '../../images/next.png'

const BtnLeft = (onClick,onDisable) => {
  return (
    <img
    src={next}
    alt=""
    width="35px"
    onClick={onClick}
    onDisable={onDisable}
    height="35px"
    style={{ float: "left", marginTop: "220px", cursor: "pointer" }}
/>
  )
}

export default BtnLeft
